			shellScript = "#!/bin/sh\nset -e\n\n# Definir archivo de log\nLOG_FILE=\"${PROJECT_DIR}/firebase_config.log\"\n\n# Función para escribir logs\nlog() {\n    echo \"$(date): $1\" | tee -a \"$LOG_FILE\"\n}\n\n# Limpiar el archivo de log anterior\n> \"$LOG_FILE\"\n\nlog \"Iniciando script de configuración de Firebase\"\nlog \"PROJECT_DIR: ${PROJECT_DIR}\"\nlog \"BUILT_PRODUCTS_DIR: ${BUILT_PRODUCTS_DIR}\"\nlog \"PRODUCT_NAME: ${PRODUCT_NAME}\"\nlog \"CONFIGURATION: ${CONFIGURATION}\"\n\n# Determinar el ambiente basado en la configuración\nif [[ \"${CONFIGURATION}\" == *\"staging\"* ]] || [[ \"${CONFIGURATION}\" == *\"Staging\"* ]]; then\n    environment=\"staging\"\nelif [[ \"${CONFIGURATION}\" == *\"production\"* ]] || [[ \"${CONFIGURATION}\" == *\"Production\"* ]] || [[ \"${CONFIGURATION}\" == \"Release\" ]]; then\n    environment=\"production\"\nelse\n    log \"Error: Configuración no reconocida: ${CONFIGURATION}\"\n    exit 1\nfi\n\nlog \"Ambiente detectado: $environment\"\n\n# Definir rutas\nSOURCE_FILE=\"${PROJECT_DIR}/Runner/Firebase/${environment}/GoogleService-Info.plist\"\nDESTINATION_FILE=\"${PROJECT_DIR}/Runner/GoogleService-Info.plist\"\n\nlog \"Copiando GoogleService-Info.plist de $SOURCE_FILE a $DESTINATION_FILE\"\n\n# Copiar el archivo GoogleService-Info.plist\nif cp \"${SOURCE_FILE}\" \"${DESTINATION_FILE}\"; then\n    log \"GoogleService-Info.plist copiado exitosamente\"\nelse\n    log \"Error: No se pudo copiar GoogleService-Info.plist\"\n    exit 1\nfi\n\n# Definir la ruta del archivo firebase_app_id_file.json\nif [ \"$environment\" == \"staging\" ]; then\n    FIREBASE_APP_ID_FILE=\"${PROJECT_DIR}/firebase_app_id_file_staging.json\"\nelse\n    FIREBASE_APP_ID_FILE=\"${PROJECT_DIR}/firebase_app_id_file_prod.json\"\nfi\n\nlog \"Usando archivo de App ID: $FIREBASE_APP_ID_FILE\"\n\n# Verificar si el archivo fuente existe\nif [ ! -f \"$FIREBASE_APP_ID_FILE\" ]; then\n    log \"Error: El archivo fuente $FIREBASE_APP_ID_FILE no existe.\"\n    exit 1\nfi\n\n# Definir las rutas de destino para el archivo firebase_app_id_file.json\nDESTINATION_APP_ID_FILE=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app/firebase_app_id_file.json\"\nIOS_ROOT_APP_ID_FILE=\"${PROJECT_DIR}/firebase_app_id_file.json\"\n\nlog \"Copiando firebase_app_id_file.json a $DESTINATION_APP_ID_FILE\"\n\n# Copiar el archivo firebase_app_id_file.json al directorio de build\nif cp \"$FIREBASE_APP_ID_FILE\" \"$DESTINATION_APP_ID_FILE\"; then\n    log \"firebase_app_id_file.json copiado exitosamente al directorio de build\"\nelse\n    log \"Error: No se pudo copiar firebase_app_id_file.json al directorio de build\"\n    exit 1\nfi\n\nlog \"Copiando firebase_app_id_file.json a $IOS_ROOT_APP_ID_FILE\"\n\n# Copiar el archivo firebase_app_id_file.json a la raíz del proyecto iOS\nif cp \"$FIREBASE_APP_ID_FILE\" \"$IOS_ROOT_APP_ID_FILE\"; then\n    log \"firebase_app_id_file.json copiado exitosamente a la raíz del proyecto iOS\"\nelse\n    log \"Error: No se pudo copiar firebase_app_id_file.json a la raíz del proyecto iOS\"\n    exit 1\nfi\n\n# Verificar si los archivos se copiaron correctamente\nif [ -f \"$DESTINATION_APP_ID_FILE\" ] && [ -f \"$IOS_ROOT_APP_ID_FILE\" ]; then\n    log \"Verificación: firebase_app_id_file.json existe en ambas ubicaciones de destino\"\n    ls -l \"$DESTINATION_APP_ID_FILE\"\n    ls -l \"$IOS_ROOT_APP_ID_FILE\"\nelse\n    log \"Error: firebase_app_id_file.json no se encontró en una o ambas ubicaciones de destino\"\n    exit 1\nfi\n\nlog \"Script de configuración de Firebase completado con éxito\"\n";
		};
